const App = () => {
	const inc = () => {
		let i = 0
		function increment (){
			i++
			return i
		}
		increment()
	}

	console.log(inc()())


	return (
		<div className="App">
			<header className="App-header">
				<p>
					Edit <code>src/App.tsx</code> and save to reload.
				</p>
				<a
					className="App-link"
					href="https://reactjs.org"
					target="_blank"
					rel="noopener noreferrer"
				>
					Learn React
				</a>
			</header>
		</div>
	);
}

export default App;
